            $rest10 = $rest50 % 10;
            $qtd10 = ($rest50 - $rest10) / 10;
            // 5
            $qtd5 = $rest10 / 5;
        ?>
        <!-- //200 -->
        <img width="200px" src="https://www.bcb.gov.br/novasnotas/assets/img/section/200/200_front.jpg">
