        <!-- //50 -->
        <img width="200px" src="data:image/jpeg;base64," alt="">
        <?= $qtd50 ?>X<br>
        <!-- //10 -->
        <img width="200px" src="data:image/jpeg;base64," alt="">
        <?= $qtd10 ?>X<br>
        <!-- //5 -->
        <img width="200px" src="data:image/jpeg;base64," alt="">
        <?= $qtd5 ?>X
